import { Button } from '@mui/material'
import React from 'react'

export const UserList = () => {


    const renderCard = () => users.map(user => (
        <div key={user.id}>
            <h3>{user.name}</h3>
            <span>{user.code}</span>
            <p>{user.type}</p>
            <p>{user.description}</p>
        </div>
    ))


  return (
    <div>
        <Button>Add user</Button>
    <div>
        {set.length ? renderCard():<p>No card</p>}
    </div>
    </div>
  )
}
